response.about:
Люблю свою семью, родных, друзей, коллег; люблю выходить на работу после отпуска; 
поздно ложиться и поздно вставать; люблю хороший слог в стихах и прозе. Очень люблю песню В.С.Высоцкого "Я не люблю".
Не люблю тоскливого ожидания, томительной неизвестности,смятения в душе от обиды, гнева или раздражения, необязательных людей,отсутствия альтернатив, очень не люблю писать отчёты...
